    "litchfield-wetland-management-district-annual-narrative-report-calendar-year-1988",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Litchfield
    Wetland Management District outlines accomplishments during the 1988 calendar year.
    The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan and compliance with environmental and cultural resource mandates.
    Administration is outlined; information about personnel, youth programs, other manpower
    programs, volunteer programs, funding, safety, and technical assistance is given.
    Habitat management is also covered; subjects include wetlands, croplands, grasslands,
    grazing, haying, fire management, pest control, and WPA easement monitoring. The
    wildlife section of the report discusses wildlife diversity, endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory
    birds, game mammals, other resident wildlife, wildlife propagation and stocking,
    and animal control. The public uses of the described in this report include interpretive
    programs, hunting, fishing, trapping, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, and computer systems.
    Cooperative programs are provided at the end. Brochures, newspaper articles, and
    field guides are attached.",nt"license_title": "License Not Specified",nt"extras":
